Description:
            { You'll LOVE it }
The Wild Abandon headband is made for movement. Whether taking your favorite spin or yoga class, running the distance or out on the town, this headband will stay put and comfortable while you're on the move. Go girl.
*Please note this fabric has a large print repeat, so the exact print varies from headband to headband as shown in the photos. 
{ Made for Motion }
Because its made of Nylon/Lycra, its light weight, washable and holds its own against a sweat sesh. As a marathoner, outdoors lover and fitness enthusiest I know it's a must! The stretchy and seamless 3.5 inch wide band is tapered in the back and will mold to your head. Uncompromised comfort!
{ How to Rock It }
For the best and most secure fit, wear this headband mid-way down your forehead!
{ About True North }
I am a creative soul who prefers to be in motion. With 8 years of buying experience in the action sports industry, I understand the importance of fashion AND function. As a 4x marathoner and fitness devotee, I had an overflowing 'headband drawer' but none I really liked. While driving home from a workout with my husband, wearing a stretched out loose headband, I said, "I'm going to make a headband that I will actually LOVE". Fast forward to fabric shopping, QT with my sewing machine and 'field testing' by family and friends and True North Collection became a reality. My wish is that True North's mix of California-boho style  functional fitness headbands will become your new favorite as well!
